import './App.css'; 
import Header from './components/Header';
import Movie from './components/Movie';
import movies from './movie.json'

function App() {

  let login = false;

  return (
    <div className="App">

    {
      (()=>{
        if(login){
          return <h1 style = {{color:'black'}}>Entry</h1>
        }
        else return <h1 style = {{color:'black'}}>No Entry</h1>
      })()
    } 

       <Header/>
       <div className="main">
       {
        movies.map((element,index) => {
          return(
        <Movie 
        key={index} 
        title ={element.Title} 
        year={element.Year}
        img={element.Poster}

         />
          )
       })
       }
       </div>
    </div>

  );
}

export default App;
